import React from 'react';
import { BrowserRouter as Router, Route } from 'react-router-dom';
import Todo from './comps/todo';
import './App.css';

function App() {
  return (
    <Router>
      <div className='App'>
        <Route path='/' exact component={Todo} />
      </div>
    </Router>
  );
}

export default App;
